import React from 'react'
import './ListingPage.css'
import MovieList from '../../API/CONTENTLISTINGPAGE-PAGE1.json'

window.mov = MovieList.page.contentitems

export default function ListingPage() {
  return (
    <div className="main">
      {MovieList.page.contentitems.content.map((item, idx)=> {
      return (<div>
        {item.name}
      <img key={idx} src={`../../Slices/${item.posterimage}`} alt={item.name}/>
      </div>
      )})}
    </div>
  )
}
